package T210930;

public class Arr02 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int []a = new int[] {23,45,67,789,2};
		
		for (int k:a) {
			System.out.println("k="+k);
		}
		System.out.println("-----");
		
		int[]c;
		c = new int[] {23,45,67,789,2};
		for (int k:c) {
			System.out.println("k= "+k);
		}
	}

}
